description.plain:
“Hallelujah” is set to appear on Keys’ upcoming  album HERE, the follow-up to 2012’s Girl on Fire;
Backed by a thundering piano-led melody Alicia seems to looking for strength and has to find it in religion.

The song debuted live on SNL and it is featured in the trailer for Let Me In, a film about refugees, that was also unveiled today. The Jonathan Olinger-directed film hits theaters June 20.

